import { Typography, TextField, Grid, Stack, TextareaAutosize, useMediaQuery, Button, Alert, MenuItem } from '@mui/material';
import React from 'react';
import PhoneInput from "react-phone-input-2";
import '../App.css';
import 'react-phone-input-2/lib/style.css'
import { useTranslation } from 'react-i18next';
import AttachFileIcon from '@mui/icons-material/AttachFile';

export default function Carrer({experiance,setExperiance,position,setPosition,school,setSchool,program,
    selectedprogram,setSelectedProgram,material,selectedmaterial,setSelectedMaterial,stage,selectedstage,
    setSelectedStage,setAlerting}) {
        const { t } = useTranslation();

  return (
    <div style={{marginTop:'30px'}}>
       <Stack direction='row' gap={7}>
         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Experience in Years")}
            </label>
            <TextField
              value={experiance}
              onChange={(e) => { setExperiance(e.target.value);setAlerting(false)}}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>


          <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Current Position")}
            </label>
            <TextField
              value={position}
              onChange={(e) => { setPosition(e.target.value) ;setAlerting(false)}}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>
          </Stack>


          <Stack direction='row' gap={7} sx={{marginTop:'20px'}}>
         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Current School")}
            </label>
            <TextField
              value={school}
              onChange={(e) => { setSchool(e.target.value);setAlerting(false)}}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>


          <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Program")}
            </label>
            <TextField
            select
            SelectProps={{ value: selectedprogram, multiple: true }}
              value={selectedprogram}
              onChange={(e) => { setSelectedProgram(e.target.value) ;setAlerting(false)}}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            >
                {program.map((c) => (
                <MenuItem value={c.id}>
                  {c.name}
                </MenuItem>
              ))}
              </TextField>
          </Grid>
          </Stack>


          <Stack direction='row' gap={7} sx={{marginTop:'20px'}}>
            

          <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Stage")}
            </label>
            <TextField
            select
            SelectProps={{ value: selectedstage, multiple: true }}
              value={selectedprogram}
              onChange={(e) => { setSelectedStage(e.target.value) ;setAlerting(false)}}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            >
                {stage.map((c) => (
                <MenuItem value={c.id}>
                  {c.name}
                </MenuItem>
              ))}
              </TextField>
          </Grid>

         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Materials")}
            </label>
            <TextField
             select
             SelectProps={{ value: selectedmaterial, multiple: true }}
              value={selectedmaterial}
              onChange={(e) => { setSelectedMaterial(e.target.value);setAlerting(false)}}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            > {material.map((c) => (
                <MenuItem value={c.id}>
                  {c.name}
                </MenuItem>
              ))}
              </TextField>
          </Grid>

          </Stack>

          <Button sx={{ color:'white',bgcolor:'#018EA2',width:'100%',fontSize:'16px',fontWeight:'bold',
             '&:hover':{color:'white',bgcolor:'#018EA2'},marginTop:'30px' }}>
                Attach Resum√© <AttachFileIcon sx={{transform:'scaleX(-20deg)'}} />
              </Button> 
    </div>
  )
}
